    /**
     * Converts the soap model instances into normal model instances.
     *
     * @param soapModels the soap model instances to convert
     * @return the normal model instances
     */
    public static List<kvjEddy> toModels(kvjEddySoap[] soapModels) {
        if (soapModels == null) {
            return null;
        }

        List<kvjEddy> models = new ArrayList<kvjEddy>(soapModels.length);

        for (kvjEddySoap soapModel : soapModels) {
            models.add(toModel(soapModel));
        }

        return models;
    }

